import React from 'react';

const Services = () => {
  return (
    <section className="services">
      <h2>Servicios</h2>
      <ul>
        <li>Construcción de Viviendas</li>
        <li>Domótica Inteligente</li>
        <li>Reformas y Remodelaciones</li>
      </ul>
    </section>
  );
};

export default Services;
